import React from "react";
import { Spinner, Button } from "react-bootstrap";

export default function Homepage() {
  return (
    <div>
      <h1>Homepage</h1>
      <Button><Spinner animation="border" role="status"></Spinner>Loading...</Button>
    </div>
  );
}
